    "SWIFT-nanoLV Avionics Platform Project",nt"tracking_summary": {ntt"total":
    1,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-07T01:20:57.271982",nt"name": "swift-nanolv-avionics-platform-project",nt"isopen":
    true,nt"url": null,nt"notes": "With the increased demand for and utility
    of nano- and micro-satellites, the demand for responsive, low-cost access to space
    has also increased. To meet this demand, multiple private companies are pursuing
    the development of nano- and micro-launch vehicles (NMLV). However, NMLV builders
    lack suitable avionics platforms for both development and operational needs. Traditional
    launch vehicle avionics platforms exceed the SWaP requirements of an NMLV due to
    their use of redundant, aerospace grade components. To service the needs of NMLV
    builders, TUI proposes to develop the SWIFT-nanoLV avionics platform by leveraging
    its existing portfolio of SWIFT software-defined radios and other small satellite
    component technologies. Through the careful use of COTS components, modular design
    techniques, and software-defined architectures, the SWIFT-nanoLV avionics platform
    will not only meet the SWaP requirements of an NMLV, but will also help minimize
    the operating costs of NMLVs. After developing a concept design and testing brassboard
    prototypes in the Phase I effort, TUI will build and test a fully functional avionics
    platform in the Phase II effort.",nt"license_title": "U.S. Government Work",nt"extras":
